member.example:
An example using the Northwind database would be to deep load a TList or VList, 
and then call list.ToDataSet(true/false);

  TList<Categories> list = DataRepository.CategoriesProvider.GetAll();
  DataRepository.CategoriesProvider.DeepLoad(list, true);
  DataSet ds = list.ToDataSet(true);
  ds.WriteXml("C:\\Test2.xml");

member.summary:
0:正常,1:未启用,2:已锁定
为了避免在代码中写死，可以通过枚举类型UserStatusValueList
给本字段赋值，如:userAccount.Status = (int)UserStatusValueList.Normal;

性别,值域:"0——女"、"1——男"、"2——保密"
为了避免在代码中写死，可以通过枚举类型UserGenderValueList
给本字段赋值，如:userAccount.Gender = (int)UserGenderValueList.Unknown;

拥车情况，值域:"0——无车"、"1——有车"、"2——保密"
    为了避免在代码中写死，可以通过枚举类型UserWithCarValueList
    给本字段赋值，如:userAccount.WithCar = (int)UserWithCarValueList.Unknown;

